import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="gray-background">
        <img src={logo} alt="logo" />
        <h2> Let's develop management system!</h2>
      </div>
    )
  }
}
